import React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import { mergeClasses } from "@mui/material/styles";

function Header() {
  return (
    <div>
      <AppBar>
        <Toolbar>
          <h1 left>BHARAT</h1>
          <h1 right>BHARAT</h1>

        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Header;
